addEventListener('fetch', event => {
    event.respondWith(handleRequest(event.request))
  })
  
  async function handleRequest(request) {
    const url = new URL(request.url)
  
    if (url.pathname === '/generate-signature') {
        const params = url.searchParams
        const name = params.get('name')
        const font = params.get('font') || 'Signerica';
        
        return new Response(generateSignatureHTML(name, font), {
            headers: { 'Content-Type': 'text/html' }
        })
    } else {
        return new Response(indexHTML(), {
            headers: { 'Content-Type': 'text/html' }
        })
    }
  }
  
  function indexHTML() {
    return `
    <!DOCTYPE html>
    <html lang="en">
    <head>
        <meta charset="UTF-8">
        <meta name="viewport" content="width=device-width, initial-scale=1.0">
        <title>English Signature Generator</title>
        <link href="https://stackpath.bootstrapcdn.com/bootstrap/4.5.2/css/bootstrap.min.css" rel="stylesheet">
        <style>
            @font-face {
                font-family: 'Signerica';
                src: url(data:font/truetype;charset=utf-8;base64,) format('truetype');
            }
            @font-face {
                font-family: 'Sabila Renytha';
                src: url(data:font/truetype;charset=utf-8;base64,) format('truetype');
            }
            @font-face {
                font-family: 'Sabina';
                src: url(data:font/truetype;charset=utf-8;base64,) format('truetype');
            }
            @font-face {
                font-family: 'Handita';
                src: url(data:font/truetype;charset=utf-8;base64,) format('truetype');
            }
            @font-face {
                font-family: 'Handmade';
                src: url(data:font/truetype;charset=utf-8;base64,) format('truetype');
            }
            @font-face {
                font-family: 'Handsnow';
                src: url(data:font/truetype;charset=utf-8;base64,) format('truetype');
            }
            @font-face {
                font-family: 'LastHand';
                src: url(data:font/truetype;charset=utf-8;base64,) format('truetype');
            }
            @font-face {
                font-family: 'Karstar';
                src: url(data:font/truetype;charset=utf-8;base64,) format('truetype');
            }
            @font-face {
                font-family: 'Signature';
                src: url(data:font/truetype;charset=utf-8;base64,) format('truetype');
            }
            @font-face {
                font-family: 'The Signature';
                src: url(data:font/truetype;charset=utf-8;base64,) format('truetype');
            }
            @font-face {
                font-family: 'Solami Signature';
                src: url(data:font/truetype;charset=utf-8;base64,) format('truetype');
            }
            @font-face {
                font-family: 'Qalisha Signature Script';
                src: url(data:font/truetype;charset=utf-8;base64,) format('truetype');
            }
            @font-face {
                font-family: 'Einstein';
                src: url(data:font/truetype;charset=utf-8;base64,) format('truetype');
            }
            body { padding-top: 50px; }
              .signature-preview { margin-top: 20px; max-width: 100%; }
              svg { border: 1px solid #ccc; width: 100%; max-width: 800px; }
          </style>
      </head>
      <body>
          <div class="container">
              <h1 class="text-center">English Signature Generator</h1>
              <form id="signature-form">
                  <div class="form-group">
                      <label for="name">Enter Your Name:</label>
                      <input type="text" class="form-control" id="name" required>
                  </div>
                  <div class="form-group">
                      <label for="font">Choose a Font:</label>
                      <select class="form-control" id="font">
                          <option value="Signerica" selected>Signerica</option>
                          <option value="Sabila Renytha">Sabila Renytha</option>
                          <option value="Sabina">Sabina</option>
                          <option value="Handita">Handita</option>
                          <option value="Handmade">Handmade</option>
                          <option value="Handsnow">Handsnow</option>
                          <option value="LastHand">LastHand</option>
                          <option value="Karstar">Karstar</option>
                          <option value="Signature">Signature</option>
                          <option value="The Signature">The Signature</option>
                          <option value="Solami Signature">Solami Signature</option>
                          <option value="Qalisha Signature Script">Qalisha Signature Script</option>
                          <option value="Einstein">Einstein</option>
                      </select>
                  </div>
                  <button type="submit" class="btn btn-primary" id="generate-btn" disabled>Generate Signature</button>
              </form>
              <div class="signature-preview text-center">
                  <svg id="signature-svg" width="800" height="200"></svg>
              </div>
          </div>
          <script src="https://ajax.googleapis.com/ajax/libs/webfont/1.6.26/webfont.js"></script>
          <script>
          document.addEventListener('DOMContentLoaded', function() {
              WebFont.load({
                  custom: {
                      families: [
                          'Signerica',
                          'Sabila Renytha',
                          'Sabina',
                          'Handita',
                          'Handmade',
                          'Handsnow',
                          'LastHand',
                          'Karstar',
                          'Signature',
                          'The Signature',
                          'Solami Signature',
                          'Qalisha Signature Script',
                          'Einstein'
                      ]
                  },
                  active: function() {
                      document.getElementById('generate-btn').disabled = false;
                  }
              });
  
              const form = document.getElementById('signature-form');
              form.addEventListener('submit', function(event) {
                  event.preventDefault();
                  const name = document.getElementById('name').value;
                  const font = document.getElementById('font').value || 'Signerica';
                  generateSignature(name, font);
              });
  
              function generateSignature(name, font) {
                  const svg = document.getElementById('signature-svg');
                  while (svg.firstChild) {
                      svg.removeChild(svg.firstChild);
                  }
  
                  let fontSize = 60;
                  const textElement = document.createElementNS('http://www.w3.org/2000/svg', 'text');
                  textElement.setAttribute('x', '50%');
                  textElement.setAttribute('y', '50%');
                  textElement.setAttribute('text-anchor', 'middle');
                  textElement.setAttribute('dominant-baseline', 'middle');
                  textElement.setAttribute('font-family', font);
                  textElement.setAttribute('font-size', fontSize);
                  textElement.setAttribute('fill', '#000');
                  textElement.textContent = name;
  
                  document.fonts.load(fontSize + 'px ' + font).then(function() {
                      svg.appendChild(textElement);
                      let bbox = textElement.getBBox();
                      while (bbox.width > svg.clientWidth * 0.9 && fontSize > 10) {
                          fontSize -= 2;
                          textElement.setAttribute('font-size', fontSize);
                          bbox = textElement.getBBox();
                      }
                      animateSignatureWithMask(textElement, svg);
                  }).catch(function(error) {
                      console.error('Font failed to load:', error);
                  });
              }
  
              function animateSignatureWithMask(textElement, svg) {
                  const svgNS = 'http://www.w3.org/2000/svg';
  
                  // Create a mask
                  const mask = document.createElementNS(svgNS, 'mask');
                  const maskId = 'mask' + Date.now();
                  mask.setAttribute('id', maskId);
  
                  // Create a rectangle for the mask
                  const rect = document.createElementNS(svgNS, 'rect');
                  rect.setAttribute('x', '0');
                  rect.setAttribute('y', '0');
                  rect.setAttribute('width', '0');
                  rect.setAttribute('height', '100%');
                  rect.setAttribute('fill', '#fff');
  
                  mask.appendChild(rect);
                  const defs = document.createElementNS(svgNS, 'defs');
                  defs.appendChild(mask);
                  svg.insertBefore(defs, svg.firstChild);
  
                  // Apply the mask to the text
                  textElement.setAttribute('mask', 'url(#' + maskId + ')');
  
                  // Animate the rectangle to reveal the text
                  rect.animate([
                      { width: '0' },
                      { width: '100%' }
                  ], {
                      duration: 3000,
                      fill: 'forwards',
                      easing: 'linear'
                  });
              }
          });
          </script>
      </body>
      </html>
      `;
  }
  
  function generateSignatureHTML(name, font) {
      const fontStyle = `font-family: '${font}', cursive;`;
      return `
      <!DOCTYPE html>
      <html lang="en">
      <head>
          <meta charset="UTF-8">
          <meta name="viewport" content="width=device-width, initial-scale=1.0">
          <title>Generated Signature</title>
          <style>
              @font-face {
                  font-family: '${font}';
                  src: url(data:font/truetype;charset=utf-8;base64,<base64>) format('truetype');
              }
              body { text-align: center; padding: 50px; max-width: 800px; margin: 0 auto;}
              svg { width: 100%; max-width: 800px; }
          </style>
      </head>
      <body>
          <div>
              <p>Your Signature:</p>
              <svg id="signature-svg" width="800" height="200">
                  <text x="50%" y="50%" text-anchor="middle" dominant-baseline="middle" font-family="${font}" font-size="50" fill="#000">${name}</text>
              </svg>
          </div>
      </body>
      </html>
      `;
  }
